import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
    <Routes>
      <Route path='./components/Home.js' element={<Home/>}></Route>
      <Route path='./components/About.js' element={<About/>}></Route>
      <Route path='./components/About.js' element={<About/>}></Route>
    </Routes>
      <Header/>
      <Hero/>
      {/* <About/> */}
      <Footer/>
    </Router>
  );
}

export default App;
